using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct DeadTagComponentResolver : IResolver<DeadTagComponent>, IResolver<DeadTagComponentResolver,DeadTagComponent>, IData	{		public DeadTagComponentResolver In(ref DeadTagComponent deadtagcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetDeadTagComponent();			Out(ref local);		}		public void Out(ref DeadTagComponent deadtagcomponent)		{		}	}}